import React from 'react';
import './aside.css';
import Rocket from './IMG/rocket.png';

const Aside = () => (
    <aside>
        <div className="conteudoDoTop">
            <img src={Rocket} alt="rocket" />
        </div>
        <div className="conteudoDoBot">
            <div className="tituloPrincipal">ROCKET ROOM</div>
            <div className="subPrincipal">
                Etiam luctus urna ex
                <br />Lorem ipsum dolor sit amet, consectetur adipiscing elit.
            </div>
            <div className="controle">
                <div className="container">
                    <div className="unidadeControladora" id="controle1" onClick={handleClick}></div>
                    <div className="unidadeControladora" id="controle2"></div>
                    <div className="unidadeControladora" id="controle3"></div>
                </div>
            </div>
        </div>
    </aside>
);

export default Aside;

function handleClick(){
    let controles = document.querySelector(".unidadeControladora");
    controles.style.backgroundColor = '#3f3f3f';
}
